  false,\n\t\"url\": null,\n\t\"notes\": \"It has been shown through a variety of
  photo-identification studies that populations of bottlenose dolphin inhabit the
  various embayments along the coast of Florida. Knowledge of population stock structure
  is critical to developing management plans and understanding how stressors impact
  individual populations. Researchers have found that photo-identification is one
  of the best ways to study populations of bottlenose dolphin in near shore environments.
  Unlike aerial and ship-board surveys, individual dolphins can be identified and
  tracked temporally and spatially, giving investigators a more comprehensive picture
  of population stock structure\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
